.trade-depth-box {
  .depth {
    height: 611px;
    border-radius: 10px;
    background-color: #fff;
    margin-bottom: 18px;
    float: none;
    .block-header {
      height: 57px;
      line-height: 57px;
      border-bottom: none;
      padding-left: 19px;
      padding-right: 19px;
      box-sizing: border-box;
    }
    .h4 {
      font-size: 16px;
      color: RGB(22, 22, 31);
      font-weight: 600;
    }
    .block-content {
      top: 57px !important;
    }
    .trade-table-list-container .thead {
      height: 27px;
      line-height: 27px;
      background-color: rgba(228, 228, 228, .25) !important;
      border-bottom: none;
      span {
        color: RGB(167, 180, 203);
        font-weigth: 600;
      }
    }
    .trade-table-list-container .tbody .symbol-item {
      line-height: 32px;
    }
    .current-price {
      height: 65px;
      font-size: 22px;
      font-weight: 700;
      border-top: 1px solid rgba(228, 228, 228, .25);
      border-bottom: 1px solid rgba(228, 228, 228, .25);
      display: flex;
      align-items: center;
      justify-content: center;
    }
  }
  .trade-table-list-container {
    .tbody {
      padding: 0;
    }
    .tr-bg {
      height: 32px;
    }
  }
  .new-tradb {
    float: none;
    height: 595px;
    .newTrade-index-container.newTrade {
      float: none;
      width: 100%;
      height: 100%;
    }
    .newTrade-index-container .block-header {
      height: 45px;
      line-height: 45px;
      background-color: #fff !important;
      border-top-left-radius: 10px;
      border-top-right-radius: 10px;
      border-bottom: none;
      span {
        color: #16161F !important;
        font-weight: 700;
        font-size: 14px;
      }
    }
    .newTrade-index-container .block-content {
      height: calc(100% - 45px);
      background-color: #fff !important;
      border-bottom-left-radius: 10px;
      border-bottom-right-radius: 10px;
    }
    .newTrade-index-container .newTrade-tbody {
      height: calc(100% - 27px);
    }
    .thead {
      height: 27px;
      line-height: 27px;
      background-color: rgba(167, 180, 203, .25) !important;
      border-bottom: none;
      span {
        color: RGB(167, 180, 203) !important;
        font-weigth: 600;
      }
    }
  }
}
